import './App.css';
import { createTheme, ThemeProvider, makeStyles } from '@material-ui/core/styles';
import NavBar from './components/navBar';
import HomeSlider from './components/HomeSlider';
import HomeShop from './components/HomeShop'
import { Typography } from '@material-ui/core';

const theme = createTheme({
  palette: {
    primary: {
      main: "#141414"
    },
    secondary: {
      main: "#f1f0ec"
    }
  },
});


const styles = makeStyles({
  TextDiv: {
    display: "inline-block"
  },
  HomeText: {
    margin: 'auto',
    marginTop: "60px",
    color: "#636363",
    marginBottom: "40px",
    fontFamilt: 'BigCaslonMedium',
    width: "700px",
  }
});

function App() {
  const classes = styles()
  return (
    <div className="App">
      <ThemeProvider theme={theme}>
        <NavBar/>
        <HomeSlider/>
        <div className={classes.TextDiv}>
          <Typography className={classes.HomeText}>
            Our premium products got the finest quality cotton that create an exquisite lightweight textile that’s both soft and crisp – guaranteed to give you a wonderful night’s sleep.
          </Typography>
        </div>
        <HomeShop/>
      </ThemeProvider>
    </div>
  );
}

export default App;
